import React from "react";
import styled from "styled-components";

const Container = styled.div`
  border: 1px solid lightgrey;
  border-radius: 2px;
  padding: 8px;
  marging: 8px;
`;

export default function Task({ task }) {
  return (
    <div>
      <Container>{task.title}</Container>
    </div>
  );
}
